test("Repeated Letters", function( assert ) {
	// Tests with input "" and with values that return null
	assert.deepEqual(count_characters(""), null);
	assert.deepEqual(count_characters("oladlpytftlg"), null);
	assert.deepEqual(count_characters("    ")["arr"], ["    "]);
	assert.deepEqual(count_characters("aaaaaaa")["arr"], ["aaaaaaa"]);
	assert.deepEqual(count_characters("    bbbbnnnn")["arr"], ["    ", "bbbb", "nnnn"]);
	assert.deepEqual(count_characters("    bbbbnnnnc")["arr"], ["    ", "bbbb", "nnnn"]);
	assert.deepEqual(count_characters("bt    bbbbnnnnc")["arr"], ["    ", "bbbb", "nnnn"]);
	assert.deepEqual(count_characters(" hytr "), null);
	assert.deepEqual(count_characters("abcdefg"), null);

	
	// Correct return testing 
	assert.deepEqual(count_characters("buhgfzzzsacmqeevvooc")["arr"], ["zzz"]);
	assert.deepEqual(count_characters("null")["arr"], ["ll"]);
	assert.deepEqual(count_characters("tppgfaggtxxeahatduuu")["arr"], ["uuu"]);
	assert.deepEqual(count_characters("gggohqofttaumvjyehhp")["arr"], ["ggg"]);
	assert.deepEqual(count_characters("ggoohqofttaummvyehhp")["arr"], ["gg", "oo", "tt", "mm", "hh"]);
	assert.deepEqual(count_characters("dokdcgjwwwwtuuuuyhqq")["arr"], ["wwww", "uuuu"]);
	assert.deepEqual(count_characters("mooffglewankddgrrxuk")["arr"], ["oo", "ff", "dd", "rr"]);
	assert.deepEqual(count_characters("nuohwgptxoooakzegggt")["arr"], ["ooo", "ggg"]);
	assert.deepEqual(count_characters("ttwojvimttedewsazcco")["arr"], ["tt", "cc"]);
	assert.deepEqual(count_characters("aabbccdd")["arr"], ["aa", "bb", "cc", "dd"]);
	assert.deepEqual(count_characters("aaaahhhh")["arr"], ["aaaa", "hhhh"]);
	assert.deepEqual(count_characters("aaaabbb")["arr"], ["aaaa"]);
	
	// Performance Tests
	assert.deepEqual(count_characters(big_sequence1)["arr"], ["vvvvvvvvvvvv"], "Passou no teste de performance 1 com resultado de sequência pequena mas grande palavra");
	assert.deepEqual(count_characters(big_sequence2)["arr"], ["hh", "jj", "aa", "kk", "ii", "gg", "pp", "bb", "cc", "dd", "ss", "ll", "qq", "xx", "zz", "çç", "ww", "yy", "nn", "mm", "ff", "ee", "oo", "vv", "uu", "tt"], "Passou no teste de performance 2 para um resultado com muitas sequências de mesmo tamanho");
});

